import React from 'react';
import './style.css';


class Cards extends React.Component {
  render() {
    return (
      <div className="cards">
        <span className="name">{this.props.name}</span>     
        <Search/>
        <AddStartUp action="Agregar Startup"/>
      </div>
    );
  }
}

export default Cards;
